// images.js
import poker_table from './poker_table.png';
import user from './user.png';

import two_of_hearts   from './Cards/2_of_hearts.png';
import three_of_hearts from './Cards/3_of_hearts.png';
import four_of_hearts  from './Cards/4_of_hearts.png';
import five_of_hearts  from './Cards/5_of_hearts.png';
import six_of_hearts   from './Cards/6_of_hearts.png';
import seven_of_hearts from './Cards/7_of_hearts.png';
import eight_of_hearts from './Cards/8_of_hearts.png';
import nine_of_hearts  from './Cards/9_of_hearts.png';
import ten_of_hearts   from './Cards/10_of_hearts.png';
import jack_of_hearts  from './Cards/jack_of_hearts.png';
import queen_of_hearts from './Cards/queen_of_hearts.png';
import king_of_hearts from './Cards/king_of_hearts.png';
import ace_of_hearts from './Cards/ace_of_hearts.png';

const images = {
  poker_table: poker_table,
  user : user,
  cards:{
      a:1
  }
};

export default images;
